import React, {useState} from "react";
import "./stars.scss";
import Typed from "react-typed";
import ConfettiButton from "./confettiButton"

export default function Intro() {
  const [clicked, setClicked] = useState({data: false})
  return (
    // <div id="home" className="intro route bg-image " style={{backgroundImage: "url("+bigImage+")"}}>
    <div id="home" className="intro route bg-image background">
      <div id="stars" />
      <div id="stars2" />
      <div id="stars3" />

      <div className="intro-content display-table">
        <div className="table-cell">
          <div className="container">
            <h1 className="intro-title mb-4">MAX VK TATTOOS</h1>
            <p className="intro-subtitle">
              <span className="text-slider-items"></span>
              <strong className="text-slider">
                <Typed
                  strings={[
                    "✨Trippy tats for groovy cats✨"
                  ]}
                  typeSpeed={80}
                  backDelay={3000}
                  backSpeed={30}
                  loop
                />
              </strong>
            </p>
            <div className="pt-3 btn-container-rainbow">
              <ConfettiButton data={clicked.data}/>
              <a
                className="rainbow-button"
                onClick={e => setClicked(!clicked.data)}
                // href="#work"

              >
                View My Work
              </a>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}
